import React from 'react';

const MovieList = props => {

  return (
    <div>
      <p>This is the movie list - {props.title}</p>
      {props.data.map(movie => (
        <div>
          <h1>{movie.title}</h1>
          <h3>{movie.director}</h3>
        </div>
      ))}
    </div>
  )
}

export default MovieList;
